	public static BitSet getCRCResult(BitSet key) {
		if(key.length() > 640)
			throw new RuntimeException("Key length cannot be greater than 640");
		
		int crclen = 32;
		BitSet result = new BitSet(crclen);
		for(int i=0; i<crclen; i++) {
			Integer[] biteq = getCRCEquation(i);
			boolean bitresult = key.get(biteq[0]);
			for(int j=1; j<biteq.length; j++) 
				bitresult ^= key.get(biteq[j]);
			if(bitresult)
				result.set(i);
		}
		
		return result;
	}
